Given that $U_n$ denotes sets in the nested interval topology we can see that
\begin{align*}
U_n \subset U_{n+1}
\end{align*}
for all $n \in \mathbb{N}$. Therefore for any two sets in the Nested Interval Topology one is a subset of the other which implies there are no disjoint open sets thus the Nested Interval Topology is Hyper-connected.

Pick $a \in X \setminus \{ p \}$, and define $f : X \to X$ by $$f(x) = \begin{cases}
p, &\text{if $x = a$} \\\
a, &\text{if $x \neq a$.}
\end{cases}$$

For any $A \subseteq X$ we have that $$f^{-1} ( A ) = \begin{cases}
\emptyset, &\text{if $a,p \notin A$} \\\
\lbrace a \rbrace, &\text{if $p \in A$ and $a \notin A$} \\\
X \setminus \lbrace a \rbrace, &\text{if $p \notin A$ and $a \in A$} \\\
X, &\text{if $a,p \in A$.}
\end{cases}$$
As each of these sets is open in $X$, then $f$ is continuous. However $f$ clearly has no fixed point.

For any $A \subseteq X$ we have that $$\overline{A} = \begin{cases}
A, &\text{if $A$ is finite} \\\
A \cup \lbrace p \rbrace, &\text{if $A$ is infinite.}
\end{cases}$$
If $A$ is countable, then so is $\overline{A}$, so $A$ cannot be dense.

spaces.proof_of_topology:
1. Note that $X \in N$ by definition and $U_1=(0,1-\frac{1}{1})=(0,0)= \emptyset$ thus $\emptyset \in N$. 

2. Let $I$ be any indexing set of $n \in \mathbb{N}$ where $\bigcup\limits_{n \in I} U_n$ where $U_n \in N$. Thus
\begin{align*}
\bigcup\limits_{n \in I} U_n &= U_{max(n) \in I}, or X
\end{align*}
Which are both open. 

3.  Let $I$ be any finite indexing set of $n \in \mathbb{N}$. Thus 
\begin{align*}
\bigcap\limits_{n \in I} U_n &= U_{min(I)}
\end{align*}
which is an open set so any finite union of open sets is open.

